import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    flex-direction: row;
    display: 'flex';
    justify-content: 'space-around';
    align-items: left;
    background: rgb(73, 79, 82);
    color: white;
`;

export const NavLink = styled.ul`
    list-style: none;
    padding: 10px auto;
`;
